<script lang="ts">
import Vue from "vue";
import anime from "animejs/lib/anime.es.js";

export default Vue.extend({
  name: "flux-animation",
  props: {
    pos: Number
  },
  data: () => ({
    animation: anime()
  }),
  mounted() {
    this.animation = anime({
      targets: '',

      duration: 1000,
      easing: 'linear',
      autoplay: false
    })
  },
  watch: {
    pos(n: number) {
      this.animation.seek(0.5 * this.animation.duration * n);
    }
  }
});
</script>

